export function getLanguageGrid() {
    const times = _.times(4, (row) => {
        let content;
        if( row %2 === 0){
            content = {
                "type": "text",
                "data": [
                    "stara czarownica",
                    "kot",
                    "super hiper bardzo stara czarownica"
                ]
            }
        } else {
            content = {
                "type": "image",
                "data": [
                    pixel,
                    jablko,
                    czarny,
                ]
            }
        }
        return getRow(row, content);
    });
    console.log(JSON.stringify(times));
    return times
}

function getRow(row, content) {

    if (content.type === "image") {
        content.data = content.data.map((dataUrl) => {
            return {
                fillColor: '#bababe',
                image: dataUrl,
                width: boxSize,
                height: boxSize
            }
        })
    } else if (content.type === "text") {
        content.data = content.data.map((text) => {
            let multiline = text.includes(" ")?0.75:1;
            const margin = parseInt(boxSize * multiline / 2 - tablePadding * 2 * Math.max(1, parseInt(text.length / 10)));
            console.log("margin for ", text, "is", margin)
            return {
                fillColor: '#bababe',text: [text], fontSize: 23, margin: [0, margin, 0, 0]}
        })
    } else {
        content.data = _.times(3, () => {
            return {
                image: pixel,
                width: boxSize,
                height: boxSize
            }
        })
    }
    return _.times(3, (col) => {
        return [{
            table: {
                border: [false, false, false, false],
                widths: [boxSize],
                heights: boxSize,
                body: [
                    [content.data[col]]
                ]
            },
            layout: {
                hLineColor: function (i, node) {
                    // return (i === 0 || i === node.table.body.length) ? 'black' :
                    return "#fff";
                },
                vLineColor: function (i, node) {
                    // return (i === 0 || i === node.table.widths.length) ? 'black' :
                    return "#fff";
                }
            }
        }

        ];
        // return {
        //     border: BORDER,
        //     text: row + ' ' + col
        // };
    });
}